import React, { FunctionComponent } from "react";
import { PopupContainer, Popup, Button } from "./styled/styled";

interface IPropsPopup {
  message: string;
}

const PopupComp: FunctionComponent<IPropsPopup> = ({ message }) => {
  return (
    <PopupContainer>
      <Popup>
        <p>{message}</p>
        <Button>close</Button>
      </Popup>
    </PopupContainer>
  );
};

export default PopupComp;
